        private void btnGo_Click(object sender, EventArgs e)
        {
            //Check for valid input
            CheckedListBox.CheckedItemCollection selectedP1s = chckdLstBxP1.CheckedItems;
            CheckedListBox.CheckedItemCollection selectedP2s = chckdLstBxP2.CheckedItems;
            CheckedListBox.CheckedItemCollection selectedP3s = chckdLstBxP3.CheckedItems;
            if (((currentStage == 0 && selectedP1s.Count != 0 && selectedP2s.Count != 0 && selectedP3s.Count != 0) || (currentStage != 0 && txtFrameID.Text != ""))
                && txtRange.Text != "" && txtSecond.Text != "" && txtCentisecond.Text != "")
            {
                List<int> possibleSetsJustPlayed = new List<int>();
                if (currentStage == 0)
                {
                    //Compile selected pieces
                    string[] selectedP1sToString = new string[selectedP1s.Count];
                    for (int i = 0; i < selectedP1s.Count; i++)
                    {
                        selectedP1sToString[i] = selectedP1s[i].ToString();
                    }

                    string[] selectedP2sToString = new string[selectedP2s.Count];
                    for (int i = 0; i < selectedP2s.Count; i++)
                    {
                        selectedP2sToString[i] = selectedP2s[i].ToString();
                    }

                    string[] selectedP3sToString = new string[selectedP3s.Count];
                    for (int i = 0; i < selectedP3s.Count; i++)
                    {
                        selectedP3sToString[i] = selectedP3s[i].ToString();
                    }

                    //Determine possible sets just played
                    for (int i = 0; i < 4096; i += 4)
                    {
                        for (int j = 0; j < selectedP1sToString.Length; j++)
                        {
                            for (int k = 0; k < selectedP2sToString.Length; k++)
                            {
                                for (int l = 0; l < selectedP3sToString.Length; l++)
                                {
                                    if (wildCanyonLayouts[i + 1] == selectedP1sToString[j] && wildCanyonLayouts[i + 2] == selectedP2sToString[k] && wildCanyonLayouts[i + 3] == selectedP3sToString[l])
                                    {
                                        possibleSetsJustPlayed.Add(i / 4);
                                    }
                                }
                            }
                        }
                    }

                    //Re-design UI for the other stages
                    chckdLstBxP1.Visible = false;
                    chckdLstBxP2.Visible = false;
                    chckdLstBxP3.Visible = false;
                    lstvwSets.Visible = true;
                    txtFrameID.Enabled = true;
                }
                else
                {
                    //Get frame ID
                    int frameIDInputted = Convert.ToInt32(txtFrameID.Text);
                    txtFrameID.Text = "";

                    //Compile all sets from the table that have all its pieces matching the pieces from the inputted frame ID
                    for (int i = 0; i < layoutsAddedToTable.Count; i++)
                    {
                        if (current1024List[layoutsAddedToTable[i]].p1hint == current1024List[frameIDInputted].p1hint &&
                            current1024List[layoutsAddedToTable[i]].p2hint == current1024List[frameIDInputted].p2hint &&
                            current1024List[layoutsAddedToTable[i]].p3hint == current1024List[frameIDInputted].p3hint)
                        {
                            possibleSetsJustPlayed.Add(layoutsAddedToTable[i]);
                        }
                    }

                    //Remove 'GO' button as there are no more stages after this
                    if (currentStage == 7)
                    {
                        btnGo.Visible = false;
                    }
                }

                //Get stage time
                int minutesInputted = 0;
                if (txtMinute.Text != "")
                {
                    minutesInputted = Convert.ToInt32(txtMinute.Text);
                }
                int secondsInputted = Convert.ToInt32(txtSecond.Text);
                int centisecondsInputted = Convert.ToInt32(txtCentisecond.Text);
                int stageTime = (minutesInputted * 3600) + (secondsInputted * 60) + ((centisecondsInputted * 3) / 5);
                txtMinute.Text = "";
                txtSecond.Text = "";
                txtCentisecond.Text = "";

                //Get range (Max range before going off page is 28)
                int rangeInputted = Convert.ToInt32(txtRange.Text);

                //Swap ranges for Dry Lagoon
                if (currentStage == 3)
                {
                    nonDLRange = txtRange.Text;
                    txtRange.Text = "22";
                }
                //And swap them back for Egg Quarters
                else if (currentStage == 4)
                {
                    txtRange.Text = nonDLRange;
                }

                //Calculate start frames for next stage
                int[] startFrames = new int[possibleSetsJustPlayed.Count];
                for (int i = 0; i < possibleSetsJustPlayed.Count; i++)
                {
                    startFrames[i] = possibleSetsJustPlayed[i] + stageTime;

                    if (currentStage == 4)
                    {
                        startFrames[i] += FEWEST_AMOUNT_OF_NON_PLAYING_FRAMES_DL;
                    }
                    else
                    {
                        startFrames[i] += FEWEST_AMOUNT_OF_NON_PLAYING_FRAMES;
                    }
                }

                //Select upcoming 1024 list
                currentStage++;
                switch (currentStage)
                {
                    case (1):
                        current1024List = pumpkinHillLayouts;
                        break;
                    case (2):
                        current1024List = aquaticMineLayouts;
                        break;
                    case (3):
                        current1024List = deathChamberLayouts;
                        break;
                    case (4):
                        current1024List = meteorHerdLayouts;
                        break;
                    case (5):
                        current1024List = dryLagoonLayouts;
                        break;
                    case (6):
                        current1024List = eggQuartersLayouts;
                        break;
                    case (7):
                        current1024List = securityHallLayouts;
                        break;
                    case (8):
                        current1024List = madSpaceLayouts;
                        break;
                }

                //Add columns to table
                lstvwSets.Clear();
                lstvwSets.Columns.Add("Piece 1", 285);
                lstvwSets.Columns.Add("Piece 2", 285);
                lstvwSets.Columns.Add("Piece 3", 285);
                lstvwSets.Columns.Add("Frame ID", 70);

                //Populate table
                layoutsAddedToTable.Clear();
                bool alreadyInTable = false;
                for (int i = 0; i < possibleSetsJustPlayed.Count; i++)
                {
                    for (int j = 0; j < rangeInputted; j++)
                    {
                        int currentFrame = (startFrames[i] + j) % 1024;

                        alreadyInTable = false;
                        for (int k = 0; k < layoutsAddedToTable.Count; k++)
                        {
                            if (currentFrame == layoutsAddedToTable[k])
                            {
                                alreadyInTable = true;
                            }
                        }

                        if (alreadyInTable == false)
                        {
                            ListViewItem item1 = new ListViewItem(current1024List[currentFrame].p1hint);
                            item1.UseItemStyleForSubItems = false;
                            item1.BackColor = DecideColor(current1024List[currentFrame].p1location);

                            ListViewItem.ListViewSubItem subitem1 = new ListViewItem.ListViewSubItem(item1, current1024List[currentFrame].p2hint);
                            subitem1.BackColor = DecideColor(current1024List[currentFrame].p2location);
                            item1.SubItems.Add(subitem1);

                            ListViewItem.ListViewSubItem subitem2 = new ListViewItem.ListViewSubItem(item1, current1024List[currentFrame].p3hint);
                            subitem2.BackColor = DecideColor(current1024List[currentFrame].p3location);
                            item1.SubItems.Add(subitem2);

                            item1.SubItems.Add("" + currentFrame);

                            lstvwSets.Items.AddRange(new ListViewItem[] { item1 });
                            layoutsAddedToTable.Add(currentFrame);
                        }
                    }
                }
            }
        }

        System.Drawing.Color DecideColor(Location location)
        {
            System.Drawing.Color color = System.Drawing.Color.Black;

            switch (location)
            {
				//Pumpkin Hill
                case (RNGPredictToolFor180.Location.PH_Church):
                    color = System.Drawing.Color.LightSkyBlue;
                    break;
                case (RNGPredictToolFor180.Location.PH_GhostTrain):
                    color = System.Drawing.Color.Orchid;
                    break;
                case (RNGPredictToolFor180.Location.PH_Pumpkin):
                    color = System.Drawing.Color.Yellow;
                    break;
					
				//Aquatic Mine
                case (RNGPredictToolFor180.Location.AM_MainRoom):
                    color = System.Drawing.Color.LightSkyBlue;
                    break;
                case (RNGPredictToolFor180.Location.AM_Attic):
                    color = System.Drawing.Color.OrangeRed;
                    break;
                case (RNGPredictToolFor180.Location.AM_GhostRoom):
                    color = System.Drawing.Color.Orchid;
                    break;
                case (RNGPredictToolFor180.Location.AM_NarrowPath):
                    color = System.Drawing.Color.Yellow;
                    break;
                case (RNGPredictToolFor180.Location.AM_BrickRoom):
                    color = System.Drawing.Color.BurlyWood;
                    break;
					
				//Death Chamber
                case (RNGPredictToolFor180.Location.DC_Red):
                    color = System.Drawing.Color.OrangeRed;
                    break;
                case (RNGPredictToolFor180.Location.DC_RedBlue):
                    color = System.Drawing.Color.PaleVioletRed;
                    break;
                case (RNGPredictToolFor180.Location.DC_Blue):
                    color = System.Drawing.Color.LightSkyBlue;
